INSERT INTO `posts` VALUES (1,'Withings API changes','I used to do this\r\n\r\n<pre>\r\n  def refresh\r\n    wuser = Withings::User.info(self.withings_id, self.withings_api_key)\r\n    wuser.share()\r\n\r\n    page = 1\r\n\r\n    has_measures = self.current_measure\r\n    measures_count = 0\r\n\r\n    begin \r\n      if has_measures\r\n        measurements = wuser.measurement_groups(:start_at=>self.current_measure.measure_date + 1.minute, :end_at => Time.now)\r\n      else\r\n        measurements = wuser.measurement_groups(:per_page => 100, :page => page, :end_at => Time.now)\r\n      end\r\n\r\n      measurements.each do |measurement|\r\n        if measurement.weight and measurement.fat and measurement.taken_at\r\n          measure = Measure.new\r\n          measure.person_id = self.id\r\n          measure.weight = measurement.weight * 2.20462262\r\n          measure.fat = measurement.fat * 2.20462262\r\n          measure.measure_date = measurement.taken_at\r\n          measure.save\r\n          measures_count = measures_count + 1\r\n        end\r\n      end    \r\n      page = page + 1\r\n    end while measurements.size > 0\r\n    \r\n    return measures_count\r\n  end\r\n</pre>\r\n\r\nIt worked great for a long time.\r\n\r\nThen suddenly it started failing.\r\n\r\nIt just gets 100 measures from Withings, then another 100 if there are more, until Withings says that\'s it, no more measures.\r\n\r\nWhat happens now is I get 100 measures over and over no matter how often I call. The per page, page, limit and offset get ignored. Luckily it\'s at least the most recent 100. I need to figure this out though I want to have the full 250 days shown of course.\r\n\r\nI dont know for sure is this Withings changed behavior or the gem I am using.\r\n\r\n<pre>\r\n  def refresh\r\n    wuser = Withings::User.info(self.withings_id, self.withings_api_key)\r\n    wuser.share()\r\n    self.measures.delete_all\r\n    measures_count = 0\r\n\r\n    measurements = wuser.measurement_groups(:per_page=>100)\r\n\r\n    measurements.each do |measurement|\r\n      if measurement.weight and measurement.fat and measurement.taken_at\r\n        measure = Measure.new\r\n        measure.person_id = self.id\r\n        measure.weight = measurement.weight * 2.20462262\r\n        measure.fat = measurement.fat * 2.20462262\r\n        measure.measure_date = measurement.taken_at\r\n        measure.save\r\n        measures_count = measures_count + 1\r\n      end\r\n    end    \r\n\r\n    return measures_count\r\n  end\r\n</pre>',1,'2011-11-02 14:43:47','2011-11-02 14:47:01',NULL,NULL),(2,'Popcorn','I blame mostly popcorn.. in that I was feeling like I was close to my goal weight and anxious to relax from very very little carbs to just very little carbs.\r\n\r\nAmong the smallish things I changed was to start having popcorn a few times a week.\r\n\r\nI think that was a bad idea.',1,'2012-05-08 18:03:11','2012-05-08 18:03:11','2012-04-22','2012-05-08'),(3,'test','test',1,'2012-05-08 19:08:16','2012-05-08 19:08:16','2012-01-01','2012-05-08'),(4,'Decent kb workout','https://www.youtube.com/watch?v=-8JbTKR50rk',1,'2014-04-07 23:27:47','2014-04-07 23:27:47','2014-03-24','2014-04-07');
/*!40000 ALTER TABLE `posts` ENABLE KEYS */;
